import React from 'react'
import { useHistory } from "react-router-dom";

export default function Login(props) {
    const history = useHistory();
    const handleLogin = () => {

        history.push("/profile");
    }
    return (
        <div>
            login here
            <button onClick={() => handleLogin()}>
                Login
            </button>
        </div>
    )
}
